import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import Slider from "react-slick";

const Carrousel = () => {
  const settings = {
    dots: true,
    isFinite: true,
    fade: true,
    autoplay: true,
    speed: 500,

  };
  return (
    <div
      className="carrousel_wrapper"
      style={{
        height: `${window.innerHeight}px`,
      }}
    >
      <Slider {...settings}>
        <div>1</div>
        <div>2</div>
        <div>3</div>
      </Slider>
    </div>
  );
};

export default Carrousel;
